import React from "react";

const Decrement = ({ decrement, onClickFunction }) => {
  const handleClick = () => {
    onClickFunction(decrement);
  };
  return (
    <button className="btn btn-danger btn-sm m-2" onClick={handleClick}>
      -{decrement}
    </button>
  );
};

export default Decrement;
